import ReactDOM from 'react-dom';
import React  from 'react';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
const root1 = ReactDOM.createRoot(document.getElementById('root1'));

root.render(<App />);
root1.render(<App />);
